import React from "react";
import { Drawer } from "antd";
import PersonalForm from "./personalForm";
const PersonDarawer = ({
  visible,
  title,
  onClose,
  onhandleAdd,
  firsItem,
  secondItem,
  thirdItem,
  fourthItem
}) => {
  return (
    <Drawer title={title} width={380} visible={visible} onClose={onClose}>
      <PersonalForm
        firstName={"First Name"}
        lastName={"Last Name"}
        gender={"Gender"}
        Address={"Address"}
        password={"password"}
        phoneNumber={"phone_number"}
        workPosition={"work_position"}
        age={"age"}
        salary={"salary"}
        email={"email"}
        date={"date"}
        onClose={onClose}
        onhandleAdd={onhandleAdd}
      />
    </Drawer>
  );
};

export default PersonDarawer;
